import React, { useEffect, useState } from 'react';
import BookItem from '../../BookItem';

const Home = () => {
  const [books, setBooks] = useState([]);
  // 함수 실행시 최초 한번 실행되는 useEffect 사용해서 데이터를 받아올것

  useEffect(() => {
    fetch('http://localhost:8080/book', { method: 'GET' })
      .then((res) => res.json())
      .then((res) => {
        console.log(1, res);
      }); // 비동기 함수
  }, []);

  return (
    <div>
      <BookItem />
    </div>
  );
};

export default Home;
